import logo from '../../images/logo.svg'

export default function Header({ loggedIn }) {
  return(
    <header className="header">
      <a href="/"><img
        src={logo}
        className="header__logo"
        alt="Логотип проекта"
      /></a>
      {loggedIn ? <>
        <span className='header__mail'></span>
        <a href='#' className="header__auth-button">Выйти</a>
      </> : <><span className='header__mail'>РеГиСтРаЦиЯ</span></>}


    </header>
  )
}
